import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { products } from "../data/products";
import { Product } from "./Product";


interface CheckInfoProductProps {
    onCheck: () => void
}

export function InfoProduct({onCheck}: CheckInfoProductProps){

    const closeHandler = (event: React.MouseEvent) => {
        event.preventDefault()
        onCheck()
    }
    
    return (
        <div className="bg-dark text-white modals">
            <img src="" alt="ProductImage" />
            <p>Name: {products[1].id}</p>
            <p>Price:</p>
            <p>Decription:</p>
            <button onClick={closeHandler}>Buy</button>
        </div>
    )
}
